import React, { useState } from "react";

function StudentDashboard() {
  // State for student profile
  const [student] = useState({
    id: "123456",
    name: "John Doe",
    program: "Computer Science",
  });

  // State for term selection
  const [term, setTerm] = useState("Fall 2025");

  // State for search and course list
  const [searchTerm, setSearchTerm] = useState("");
  const [courses, setCourses] = useState([
    { code: "CS101", name: "Intro to Programming" },
    { code: "CS201", name: "Data Structures" },
    { code: "CS301", name: "Databases" },
    { code: "CS401", name: "Software Engineering" },
  ]);
  const [registered, setRegistered] = useState([]);

  // Handle course registration
  const handleRegister = (course) => {
    if (!registered.includes(course)) {
      setRegistered([...registered, course]);
    }
  };

  // Filtered courses based on search
  const filteredCourses = courses.filter(
    (c) =>
      c.code.toLowerCase().includes(searchTerm.toLowerCase()) ||
      c.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div style={{ padding: "20px" }}>
      <h1>ðŸŽ“ Student Dashboard</h1>

      {/* Profile Section */}
      <section style={{ marginBottom: "20px" }}>
        <h2>Profile</h2>
        <p><b>ID:</b> {student.id}</p>
        <p><b>Name:</b> {student.name}</p>
        <p><b>Program:</b> {student.program}</p>
      </section>

      {/* Term Selection */}
      <section style={{ marginBottom: "20px" }}>
        <h2>Term Selection</h2>
        <select value={term} onChange={(e) => setTerm(e.target.value)}>
          <option>Fall 2025</option>
          <option>Winter 2026</option>
          <option>Spring 2026</option>
        </select>
      </section>

      {/* Search Courses */}
      <section style={{ marginBottom: "20px" }}>
        <h2>Search Courses</h2>
        <input
          type="text"
          placeholder="Search by code or name..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          style={{ width: "300px", padding: "5px" }}
        />
      </section>

      {/* Course List */}
      <section style={{ marginBottom: "20px" }}>
        <h2>Available Courses</h2>
        <ul>
          {filteredCourses.map((course) => (
            <li key={course.code}>
              {course.code} - {course.name}{" "}
              <button onClick={() => handleRegister(course)}>
                Register
              </button>
            </li>
          ))}
        </ul>
      </section>

      {/* Registered Courses */}
      <section>
        <h2>Registered Courses</h2>
        {registered.length === 0 ? (
          <p>No courses registered yet.</p>
        ) : (
          <ul>
            {registered.map((c) => (
              <li key={c.code}>{c.code} - {c.name}</li>
            ))}
          </ul>
        )}
      </section>
    </div>
  );
}

export default StudentDashboard;
